import React, { useState, useEffect } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';

const Sidebar = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const [users, setUsers] = useState([]);
    
    // FETCH ROLE FROM STORAGE
    const currentRole = localStorage.getItem('role');

    useEffect(() => {
        // Debugging: Console check karein (F12)
        console.log("Current Sidebar Role Check:", currentRole);

        if (currentRole === 'admin') {
            axios.get('http://127.0.0.1:8000/api/admin/users')
                 .then(res => setUsers(res.data))
                 .catch(err => console.error("Admin user load error"));
        }
    }, [currentRole]);

    return (
        <div style={styles.sidebar}>
            <div style={{ textAlign: 'center', marginBottom: '40px' }}>
                <div style={styles.avatar}>üèõÔ∏è</div>
                <h3 style={{ color: '#38bdf8', marginTop: '10px' }}>DeepGuard</h3>
                <p style={{fontSize: '10px', color: '#64748b'}}>{currentRole === 'admin' ? "ADMIN MODE" : "OPERATOR MODE"}</p>
            </div>

            <div style={styles.label}>MAIN MENU</div>
            <Link to="/dashboard" style={styles.navLink(location.pathname === '/dashboard')}>üìä Dashboard</Link>
            <Link to="/history" style={styles.navLink(location.pathname === '/history')}>üìú Forensic History</Link>

            {/* --- üöÄ ADMIN ONLY SECTION (Nazar Nahi Aa Raha? Yahan Check Karein) --- */}
            {currentRole === 'admin' && (
                <div style={{ marginTop: '30px', flex: 1 }}>
                    <div style={styles.label}>IDENTITY MANAGEMENT</div>
                    
                    {/* Ye raha blue button */}
                    <Link to="/admin-panel" style={styles.assignBtn}>
                        ‚ûï Assign New Member
                    </Link>

                    <div style={styles.userScroll}>
                        {users.map(u => (
                            <div key={u.user_id} style={styles.userCard}>
                                <div style={styles.roleDot(u.role)}></div>
                                <div>
                                    <div style={{fontSize: '12px', color: 'white'}}>{u.full_name}</div>
                                    <div style={{fontSize: '9px', color: '#38bdf8'}}>{u.role.toUpperCase()}</div>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            )}

            <div style={{marginTop: 'auto'}}>
                <button onClick={() => { localStorage.clear(); navigate('/'); }} style={styles.logoutBtn}>
                    üö™ Exit System
                </button>
            </div>
        </div>
    );
};

const styles = {
    sidebar: { width: '260px', backgroundColor: '#0f172a', height: '100vh', padding: '20px', borderRight: '1px solid #1e293b', display: 'flex', flexDirection: 'column' },
    avatar: { width: '60px', height: '60px', backgroundColor: '#1e293b', borderRadius: '50%', display: 'flex', justifyContent: 'center', alignItems: 'center', margin: '0 auto', fontSize: '30px', border: '2px solid #38bdf8' },
    label: { fontSize: '10px', color: '#475569', letterSpacing: '1px', marginBottom: '15px' },
    navLink: (active) => ({ display: 'block', padding: '12px', color: active ? '#38bdf8' : '#94a3b8', textDecoration: 'none', backgroundColor: active ? '#1e293b' : 'transparent', borderRadius: '8px', marginBottom: '5px' }),
    assignBtn: { display: 'block', textAlign: 'center', padding: '10px', backgroundColor: '#38bdf8', color: '#0f172a', textDecoration: 'none', borderRadius: '8px', fontWeight: 'bold', fontSize: '12px', marginBottom: '20px' },
    userScroll: { maxHeight: '250px', overflowY: 'auto' },
    userCard: { display: 'flex', alignItems: 'center', gap: '10px', padding: '10px', backgroundColor: '#1e293b55', borderRadius: '10px', marginBottom: '8px' },
    roleDot: (role) => ({ width: '8px', height: '8px', borderRadius: '50%', backgroundColor: role === 'admin' ? '#f59e0b' : '#38bdf8' }),
    logoutBtn: { width: '100%', padding: '12px', border: '1px solid #ef4444', backgroundColor: 'transparent', color: '#ef4444', borderRadius: '10px', cursor: 'pointer' }
};

export default Sidebar;
